import './PageLogin.css';
import Subtittle from './../Subtittle/index';
import Tittle from './../Tittle/index';
import imagemLogin from '../../assets/img/imagem-login.png';
import CampoDeDigitacao from '../CampoDeDigitacao';
import Botao from '../Botao';

function PageLogin() {
    return (
        <div classname="container-login">
            <img src={imagemLogin} alt="Uma mulher negra de cabelos crespos usando Ã³culos" />

            <section>
                <form>
                    <Tittle />
                    <Subtittle />
                    <CampoDeDigitacao
                        label=""  
                        tipo="email"
                        placeholder="Digite o seu e-mail ou snha" 
                    />
                    <div className='form__campo-digitacao'>
                        <label for="senha">Senha</label>
                        <input 
                            type="password" 
                            placeholder='Digite sua senha'
                            required
                            id="senha"
                        />
                    </div>
                    <Botao />
                </form>
            </section>
        </div>
    );
};

export default PageLogin;
